(()=>{var urls=[],doms=document.getElementsByClassName("entry-content")[0].children;for(dom of doms)if("P"==dom.tagName){var list=dom.getElementsByTagName("img")[0].srcset.split(/w, | |w$/g),size=[],url=[],max={size:0,url:""};for(i in list)i%2?size.push(+list[i]):url.push(list[i]);for(i in size)size[i]>max.size&&(max.size=size[i],max.url=url[i]);urls.push(max.url)}var title="nukeman-"+location.href.split("/")[3];savedojin.makedom(urls,title)})();